const SearchBar = ({keyword, onChange}) => {
    const BarStyle = {fontFamily: 'Source Sans Pro'};
    return (
      <input 
       style={BarStyle}
       key="search-bar"
       value={keyword}
       placeholder={"Search"}
       onChange={(e) => onChange(e.target.value)}
      />
    );
  }
  
  export default SearchBar;
